      val no_apdu: Array[String] = Array(
      )

      var apdus = no_apdu

      // nano s
      if (result.intTargetId == 0x01000001) {
        apdus = nanos_mcu11Apdus
        // no version specified, proceed with MCU BL upgrade (seed is likely to be reset as the new flow won't acknowledge the MCU signature)
        if (result.version == "0.0.0") {
          apdus = nanos_blmcu06Apdus
        }
        // likely the MCU bootloader
        else if (result.version == "0.6") {
          apdus = nanos_mcu15Apdus
        }
      }
      // blue hw 1.0
      else if (result.intTargetId == 0x04000001) {
        // default is to update bootloader
        apdus = blue_mcu25blup
        // latest mcu version
        if (result.version == "2.5-hw1") {
          apdus = blue_mcu25seph
        }
      }
      // blue hw 1.5
      else if (result.intTargetId == 0x04100001) {
        // default is to update bootloader
        apdus = blue_mcu34blup
        // latest mcu version
        if (result.version == "3.4-hw15") {
          apdus = blue_mcu34seph
        }
      }

      // patch if anything to patch
      var offset = 0
      def iterate(): Future[Unit] = {
        sendApdu(HexUtils.decodeHex(apdus(offset))) flatMap { (result) =>
          matchErrorsAndThrow(result)
          offset += 1
          if (offset == apdus.length) {
            val promise = Promise[Unit]()
            setTimeout(5000) {
              promise.success()
            }
            promise.future

          } else {
            iterate()
          }
        }
      }
      iterate()
    })

  }

  def validateTargetId(target: Array[Byte]): Future[Unit] = {
    sendApdu(0xE0, 0x04, 0x00, 0x00, 0x00, target.slice(0, 4), 0x00) map {(result) =>
      result.sw match {
        case 0x9000 =>
          ()
        case other =>
          throw LedgerApiUnknownErrorException(other)
      }
    }
  }

  def isBolosInApp(): Future[Boolean] = {
    getFirmwareVersion() flatMap {(version) =>
      validateTargetId(version.targetId)
    } map {(_) =>
      false
    } recover {
        case throwable: LedgerApiException =>
          true
        case other => throw other
      }
    }

  def exchange(command: Array[Byte]): Future[Array[Byte]] = {
    sendApdu(command) map {(result) =>
      matchErrorsAndThrow(result)
      result.data.readNextBytesUntilEnd()
    }
  }

